import React from 'react'
import {connect} from "react-redux";
import Header from "../_layouts/_includes/header/Header";
import Drawer from "../_layouts/_includes/drawer/Drawer";
import Content from "../_layouts/_includes/content/Content";

class SuggestPage extends React.Component {

    render() {
        return (
            <>
                <Header/>
                <Drawer/>
                <Content>
                    <div>
                        Suggest Form
                    </div>
                    <Footer/>
                </Content>
            </>
        )
    }
}

export default connect()(SuggestPage)
